// src/nodes/FilterNode.js
import React from "react";
import BaseNode from "./BaseNode";

export default function FilterNode({ id, data }) {
  return (
    <BaseNode
      id={id}
      data={{
        title: "Filter",
        subtitle: data?.rule || "contains",
        inputs: [
          { id: `${id}-in`, label: "in" },
          { id: `${id}-rule`, label: "rule" },
        ],
        outputs: [{ id: `${id}-out`, label: "out" }],
        children: <div>Filters passing data (demo).</div>,
      }}
    />
  );
}
